Eligibility:
To be eligible to apply for this grant, the business must:

- have fewer than 20 employees (by head count) at the time of applying for the grant;
- have an active Australian Business Number (ABN) and be registered for GST;
- have a Queensland headquarters;
- have an expected turnover of $300,000 or less for the current financial year; and
- have owners/directors that are not insolvent or an undischarged bankrupt.

The applying business must be able to provide the following supporting documentation:

- a certified statutory declaration from the business' owner or director stating the business: has an expected turnover of $300,000 or less for the current finanical year and meets all grant eligibilty criteria; and
- supplier quotes (no more than two) detailing description and costs of services, who will undertake the activity, and an outline of key activities.

Only 1 application will be accepted from an individual ABN or a financial beneficiary of a business for consideration at any one time.

